try {
/* module-key = 'com.stiltsoft.confluence.plugin.tablefilter.tablefilter:editor-extensions', location = 'js/editor-extensions.js' */
(function ($) {

    AJS.bind("init.rte", function() {
        var selectTable = function () {
            var node = $(tinymce.activeEditor.selection.getNode());
            if (!node.is('table')) {
                node = node.parents('table').eq(0);
            }           
            tinymce.activeEditor.selection.select(node[0]);
            return node;
        };

        var insertMacro = function(macroName) {
            if ($('#rte-toolbar-row-default').is('.disabled')) return;
            var node = selectTable();

            var macroHtml = '<table class="wysiwyg-macro" data-macro-name="table-filter" data-macro-parameters="" data-macro-schema-version="1" data-macro-body-type="RICH_TEXT"><tbody><tr><td class="wysiwyg-macro-body">' +
                AJS.Rte.getEditor().serializer.serialize(node.clone()[0], {
                    forced_root_block: false
                }) + '</td></tr></tbody></table>';

            var macroDefinition;
            $.ajax({
                type: "POST",
                contentType: "application/json; charset=utf-8",
                url: AJS.params.contextPath + "/rest/tinymce/1/macro/definition",
                async: false,
                data: AJS.$.toJSON({
                    contentId: AJS.params.contentId || AJS.Meta.get("content-id") || AJS.params.pageId || AJS.Meta.get("page-id"),
                    macroHtml: macroHtml
                }),
                dataType: "text",
                success: function (macro) {
                    macroDefinition = $.secureEvalJSON(macro);
                }
            });

            tinymce.confluence.macrobrowser.macroBrowserToolbarButtonClicked({presetMacroName: macroName, selectedMacro: macroDefinition});
        };

        Confluence.Editor.tableToolbar.Buttons.splice(Confluence.Editor.tableToolbar.Buttons.length - 2, 0,
            new Confluence.Editor.Toolbar.Components.Group([
                new Confluence.Editor.Toolbar.Components.Button({
                    text: "Filter table data",
                    iconClass: "table-filter-insert",
                    click: function () {
                        insertMacro("table-filter");
                    }
                }),
                new Confluence.Editor.Toolbar.Components.Button({
                    text: "Create a pivot table",
                    iconClass: "pivot-table-insert",
                    click: function () {
                        insertMacro("pivot-table");
                    }
                }),
                new Confluence.Editor.Toolbar.Components.Button({
                    text: "Create a chart from data series",
                    iconClass: "table-chart-insert",
                    click: function () {
                        insertMacro("table-chart");
                    }
                })
            ])
        );

        var iframeDoc = $('#wysiwygTextarea_ifr')[0].contentDocument;
        Confluence.Editor.tableToolbar.Buttons.splice(Confluence.Editor.tableToolbar.Buttons.length - 2, 0,
            new Confluence.Editor.Toolbar.Components.Group([
                new Confluence.Editor.Toolbar.Components.Button({
                    text: "Copy table",
                    iconClass: "tf-copy-table",
                    click: function () {
                        if ($('#rte-toolbar-row-default').is('.disabled')) return;
                        tinymce.activeEditor.focus();
                        var range = tinymce.activeEditor.selection.getRng();
                        selectTable();
                        iframeDoc.execCommand("copy");
                        tinymce.activeEditor.selection.setRng(range);
                    }
                })
            ])
        );

        AJS.Confluence.PropertyPanel.Macro.registerButtonHandler("unwrap-tf", function(e, macroNode) {
            AJS.Rte.BookmarkManager.storeBookmark();
            var macro = $(macroNode);
            var tf = window.TFEditor ? TFEditor.tfs[macro.attr('id')] : null;
            if (tf) {
                TFEditor.destroyFilter(tf);
            }
            AJS.Rte.getEditor().selection.select(macroNode);
            AJS.Rte.getEditor().execCommand('mceInsertContent', false, macro.find('.wysiwyg-macro-body').html());
            AJS.Rte.BookmarkManager.restoreBookmark();
        });
    });
})(jQuery);



}catch(e){WRMCB(e)};
;
