/* module-key = 'com.stiltsoft.confluence.plugin.tablefilter.tablefilter:web-resources', location = 'js/filter-utils.js' */
(function ($) {

    window.TFUtils = {

        loadScriptsBeforeExport: function(callback) {
            if (window.pdfMake) {
                callback();
            } else {
                TFUtils.loadResource('com.stiltsoft.confluence.plugin.tablefilter.tablefilter:export-pdf-resources', callback);
            }
        },

        loadD3Scripts: function(callback) {
            if (window.d3) {
                callback();
            } else {
                TFUtils.loadResource('com.stiltsoft.confluence.plugin.tablefilter.tablefilter:d3-resources', callback);
            }
        },

        getCurrentUserFullName: function() {
            return AJS.params.currentUserFullname;
        },

        getCurrentUserName: function() {
            return AJS.params.remoteUser;
        },

        saveMacroParams: function(data) {
            $.ajax({
                contentType: "application/x-www-form-urlencoded; charset=utf-8",
                type: 'POST',
                cache: false,
                url: Confluence.getContextPath() + '/rest/table-filter/1.0/service/save-tf',
                dataType: 'json',
                data: data
            });
        },

        loadResource: function(key, callback) {
            $.ajax({
                contentType: "application/x-www-form-urlencoded; charset=utf-8",
                type: 'GET',
                url: Confluence.getContextPath() + '/rest/table-filter/1.0/service/load-resource',
                dataType: 'text',
                data: {
                    key: key
                },
                success: function(data) {
                    $('head').append(data);
                    callback();
                }
            });
        },

        setCookie: function(name, value, isObject) {
            var encodedValue = isObject ? JSON.stringify(value) : value;
            document.cookie = name + "=" + encodeURIComponent(encodedValue) + "; max-age=" + 60 * 60 * 24 * 3000;
        },

        getCookie: function(name, isObject) {
            var cookie = document.cookie;
            if (cookie.length != 0) {
                var re = new RegExp('[; ]' + name + '=([^\\s;]*)');
                var matcher = (' ' + document.cookie).match(re);
                if (matcher) {
                    return isObject ? JSON.parse(decodeURIComponent(matcher[1])) : decodeURIComponent(matcher[1]);
                }
            }
            return '';
        },

        storeValue: function(name, value) {
            localStorage.setItem(name, value);
        },

        removeValue: function(name) {
            localStorage.removeItem(name);
        },

        getStoredValue: function(name) {
            return localStorage.getItem(name);
        },

        removeValue: function(name) {
            return localStorage.removeItem(name);
        }
    };

})(jQuery);





