/**
 * This section is required for select2 bindings for restricted group.
 * The section has nothing to do with enable/disable any permission related thing
 */
function bindSelect2() {

    AJS.toInit(function ($) {
        var groups;

        AJS.$.ajax({
            url: AJS.params.baseUrl + "/rest/scriptrunner-confluence/latest/lock-content-macro/groups",
            dataType: 'json',
            type: "GET",
            quietMillis: 250,
            success: function (data) {
                groups = data.groups;
            }
        });

        function appendSelect(select, data) {
            data.forEach(function (item) {
                var optionStr = "<option>" + item + "</option>";
                select.append(optionStr);
            });
        }

        function setValueForRestrictedGroupSelect2(groups) {
            if (groups) {
                AJS.$("#macro-param-restricted-group").val(JSON.parse(groups)).trigger("change");
            }
        }

        AJS.MacroBrowser.setMacroJsOverride("lock-content-macro", {
            "fields": {
                "string": {
                    "restrictedGroup": function () {
                        var paramDiv = $(Confluence.Templates.MacroBrowser.macroParameter()),
                            $select = $('<select/>').appendTo(paramDiv);

                        $select.attr("id", "macro-param-restricted-group").attr("multiple", true);
                        appendSelect($select, groups);

                        var $input = $('<input type="hidden"/>').appendTo(paramDiv);

                        $select.on("change", function () {
                            $input.val(JSON.stringify($(this).val()));
                            $input.trigger("change");
                        });
                        return AJS.MacroBrowser.Field(paramDiv, $input, {});
                    }
                }
            },
            "beforeParamsSet": function (selectedParams) {
                AJS.$("#macro-param-div-restrictedGroup input").hide();
                AJS.$("#macro-param-restricted-group").auiSelect2({
                    allowClear: true
                });
                setValueForRestrictedGroupSelect2(selectedParams.restrictedGroup);
                return selectedParams;
            }
            ,
            "beforeParamsRetrieved": function (selectedParams) {
                $(".select2-search-choice-close").each(function () {
                    $(this).data("events").click.splice(1, 1);
                });
                return selectedParams;
            }
        });

    });
}
