AJS.toInit(function($) {

    function updateVersions(location, selectedVersion) {
        $.ajax({
            type: "GET",
            dataType: "json",
            url: AJS.contextPath() + "/rest/scriptrunner-confluence/latest/content-info/history",
            data: {
                location: location,
                spaceKey: AJS.params.spaceKey
            }

        }).fail(function (jqxhr, textStatus, status) {
            if (jqxhr.status == 403) {
                alert("You do not have permission to view the included page, press Cancel");
            }
            else {
                alert("Failed to get versions for this page: " + jqxhr.responseText);
            }
        }).done(function (data) {
            var $select = $("#macro-param-location-select");
            $select.empty().append("<option value='0'>Latest</option>");
            
            $.each(data, function (i, j) {
                var $opt = $("<option>" + j + "</option>");

                if (j == selectedVersion) {
                    $opt.attr("selected", "selected");
                }
                
                $select.append($opt)
            });

            if (selectedVersion == undefined) {
                $select.find("option:nth(1)").attr("selected", "selected")
            }

            $select.trigger("change");
        })
    }

    AJS.MacroBrowser.setMacroJsOverride("include-version", {

        "fields": {
            "int": {
                "version": function() {
                    var paramDiv = $(Confluence.Templates.MacroBrowser.macroParameterSelect()),
                        select = $("select", paramDiv).attr("id", "macro-param-location-select"),
                        $input = $('<input type="hidden"/>').appendTo(paramDiv);

                    select.bind("change", function () {
                        $input.val($(this).val());
                        $input.trigger("change");
                    });
                    
                    return AJS.MacroBrowser.Field(paramDiv, $input, {});
                }
            }
        },

        "beforeParamsSet": function (selectedParams) {

            $("#macro-param-location").on("selected.autocomplete-content", function () {
                updateVersions($(this).val())
            });

            // add options to version picker field if we have an existing page, otherwise do nothing
            if ("location" in selectedParams) {
                updateVersions(selectedParams["location"], selectedParams["version"])
            }

            return selectedParams;
        }
    });
});
