AJS.toInit(function ($) {

    /**
     * Set option value for select2 drop down. The function reads option from   currencyFrom select component
     * and set the options for select2 drop down
     * @param select
     */
    function appendSelect(select) {
        AJS.$("#macro-param-currencyFrom.select > option").each(function () {
            var optionStr = "<option>" + this.value + "</option>";
            select.append(optionStr);
        });

    }

    /**
     * set value for select2 component
     */
    function setCurrencyFromSelect2Value(currencyTo) {
        if (currencyTo) {
            var currencyToArr = JSON.parse(currencyTo);
            AJS.$("#macro-param-select").val(currencyToArr).trigger("change");
        }
    }

    AJS.MacroBrowser.setMacroJsOverride("currency-converter", {
        "fields": {
            "string": {
                "currencyTo": function () {

                    var paramDiv = $(Confluence.Templates.MacroBrowser.macroParameter()),
                        $select = $('<select/>').appendTo(paramDiv);

                    $select.attr("id", "macro-param-select").attr("multiple", true);
                    appendSelect($select);

                    var $input = $('<input type="hidden"/>').appendTo(paramDiv);

                    $select.on("change", function (event) {
                        $input.val(JSON.stringify($(this).val()));
                        $input.trigger("change");
                    });

                    return AJS.MacroBrowser.Field(paramDiv, $input, {});
                }
            }
        },

        "beforeParamsSet": function (selectedParams) {
            AJS.$("#macro-param-div-currencyTo input").hide();
            AJS.$("#macro-param-select").auiSelect2({
                allowClear: true
            });

            //set value from previously selected params
            var currencyTo = selectedParams.currencyTo;
            setCurrencyFromSelect2Value(currencyTo);

            return selectedParams;
        },

        "beforeParamsRetrieved" : function (seletedParams) {
            /**This section is necessary to avoid unexpected behaviour when removing an previously selected item
             * This is not a good solution but we could't find a better way!
             */
            $(".select2-search-choice-close").each(function () {
                $(this).data("events").click.splice(1, 1);
            });

            return seletedParams;
        }
    });
});

